import React from 'react';
import './BookCard.css';

const BookCard = ({ book, addToBookshelf }) => {
    return (
        <div className="book-card">
            {book.coverUrl && <img className='book-cover' src={book.coverUrl} alt={book.title} />}

            <div className='book-info'>

            </div>
        </div>
    );
};

export default BookCard;
